import React from 'react';
import Paper from '@material-ui/core/Paper';
import { makeStyles } from '@material-ui/core/styles';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import PhoneIcon from '@material-ui/icons/Phone';
import FavoriteIcon from '@material-ui/icons/Favorite';
import PersonPinIcon from '@material-ui/icons/PersonPin';

import styled from 'styled-components';
import { LibraryBooksOutlined, GroupOutlined, BallotOutlined } from '@material-ui/icons';
import { FormControl, InputLabel, Select } from '@material-ui/core';

const Wrapper = styled.div`
	display: flex;
	flex-direction: column;
	margin-bottom: -30px;
`;

export default function TestSelectFilterBar() {
	const [value, setValue] = React.useState(0);
	const [sortBy, setSortBy] = React.useState('Popular');

	const handleChange = (event, newValue) => {
		setValue(newValue);
	};

	const handleSortChange = event => {
		setSortBy(event.target.value);
	};

	return (
		<Wrapper>
			<div className="gutter-b kt-portlet kt-portlet--height-fluid">
				<Tabs
					value={value}
					onChange={handleChange}
					variant="fullWidth"
					indicatorColor="primary"
					textColor="primary"
					aria-label="Filter Test Libary"
				>
					<Tab icon={<LibraryBooksOutlined />} label="All tests" />
					<Tab icon={<BallotOutlined />} label="Academic" />
					<Tab icon={<GroupOutlined />} label="General Training" />
				</Tabs>
			</div>
			{/* <StyledSortFormControl variant="outlined">
        <InputLabel htmlFor="outlined-age-native-simple">Sort by:</InputLabel>
        <Select
          native
          value={sortBy}
          onChange={handleSortChange}
          label="Sort by:"
        >
          <option value="Popular">Popular</option>
          <option value="Newest">Newest</option>
        </Select>
      </StyledSortFormControl> */}
		</Wrapper>
	);
}
